import React, {Component} from 'react';
import Headshot from "../Images/Photo.jpg";

import{
  Link    //Within react - you don't use anchor tags - don't want to navigate to another page
  //custom element
} from 'react-router-dom';
//import Header from '.components/headerComponent/header';
import { render } from '@testing-library/react';

class Header2 extends Component {
  render() {
  return (
    <header>   

{/* <img src={Headshot} alt = "Headshot" /> */}

    <nav className = "left">

        <ul>
        <li className="linkedIn">
           <a href="https://www.linkedin.com/in/joshua-boss-a50b9b179/">Linkedin</a>        
         </li>

           <li>
              <a href ="https://github.com/jsboss5">GitHub</a> 
           </li>



        </ul>

    </nav>





    <nav class="right">

        <ul>

           <li className="first">
           <Link to="/">Home</Link>            </li>

           <li>
              <Link to="/Products">Products</Link> 
           </li>
           <li className="last">
           <Link to="/">Contacts</Link> 
           </li>
        </ul> 

    </nav>

    </header>   

    );
  }
}
export default Header2;
